import styled from 'styled-components';

export const Container = styled.nav`
    padding: 1rem 5rem;
    display: flex;
    align-items: center;
    justify-content: start;
    flex-wrap: wrap;
    div{
      display: flex;
      justify-content: space-between;
      align-items: center;
      position: relative;
      a{
        padding: 0 2rem;
        text-align: center;
        font-size: 1rem;
        font-weight: 600;
        color: #071242;
        text-decoration: none;
        cursor: pointer;

      }


    };
`
